import './App.css';
import React from 'react';
import Header from './Header/Header';
import Main from './Main/Main';
import Footer from './Footer/Footer';
import PopupWithForm from './PopupWithForm/PopupWithForm';
import ImagePopup from './ImagePopup/ImagePopup';


function App() {

  const [selectedCard, setSelectedCard] = React.useState()

  function handleCardClick(card) {
    setSelectedCard(card)
  }

  const [isEditProfilePopupOpen, setIsEditProfilePopupOpen] = React.useState(false);
  const [isAddPlacePopupOpen, setIsAddPlacePopupOpen] = React.useState(false);
  const [isEditAvatarPopupOpen, setIsEditAvatarPopupOpen] = React.useState(false);

  function closeAllPopups() {
    setIsEditAvatarPopupOpen(false)
    setIsEditProfilePopupOpen(false)
    setIsAddPlacePopupOpen(false)
    setSelectedCard(null)
  }

  function handleEditAvatarClick() {
    setIsEditAvatarPopupOpen(true);
  }

  function handleEditProfileClick() {
    setIsEditProfilePopupOpen(true);
  }

  function handleAddPlaceClick() {
    setIsAddPlacePopupOpen(true)
  }

  return (
    <>
      <Header />
      <Main
        onEditProfile={handleEditProfileClick}
        onAddPlace={handleAddPlaceClick}
        onEditAvatar={handleEditAvatarClick}
        onCardClick={handleCardClick}
      />
      <Footer />
      <ImagePopup
        card={selectedCard}
        onClose={closeAllPopups}
      />
      <PopupWithForm
        onClose={closeAllPopups}
        isOpen={isEditProfilePopupOpen ? 'popup_opened' : ''}
        name='edit'
        title='Редактировать профиль'
        children={
          <form
            name='profile-edit-form'
            className='edit-form profile-edit-form'
          >
            <input
              required
              minLength='2'
              maxLength='40'
              placeholder='Имя'
              type='text'
              className='edit-form__input edit-form__input_profile-name'
              name='profile-edit-form-name'
            />
            <span className='profile-edit-form-name-error edit-form__error'></span>
            <input
              required
              minLength='2'
              maxLength='200'
              placeholder='О себе'
              type='text'
              className='edit-form__input edit-form__input_profile-job'
              name='profile-edit-form-job'
            />
            <span className='profile-edit-form-job-error edit-form__error'></span>
            <button
              type='submit'
              className='edit-form__save-button'
              name='profile-edit-form-save-button'
            >
              Сохранить
            </button>
          </form>
        }
      />
      <PopupWithForm
        onClose={closeAllPopups}
        isOpen={isAddPlacePopupOpen ? 'popup_opened' : ''}
        name='card'
        title='Новое место'
        children={
          <form name='add-form' className='edit-form add-form'>
            <input
              required
              minLength='2'
              maxLength='30'
              type='text'
              placeholder='Название'
              className='edit-form__input edit-form__input_card-name'
              name='input-card-name'
            />
            <span className='input-card-name-error edit-form__error'></span>
            <input
              required
              type='url'
              placeholder='Ссылка на картинку'
              className='edit-form__input edit-form__input_card-link'
              name='input-card-link'
            />
            <span className='input-card-link-error edit-form__error'></span>
            <button
              type='submit'
              className='edit-form__save-button'
              name='add-edit-form-save-button'
            >
              Создать
            </button>
          </form>
        }
      />

      <PopupWithForm
        onClose={closeAllPopups}
        isOpen={isEditAvatarPopupOpen ? 'popup_opened' : ''}
        name='avatar'
        title='Обновить аватар'
        children={
          <form name='avatar-edit-form' className='edit-form avatar-edit-form'>
            <input
              required
              type='url'
              placeholder='Ссылка на картинку'
              className='edit-form__input edit-form__input_avatar-link'
              name='avatar-edit-input'
            />
            <span className='avatar-edit-input-error edit-form__error'></span>
            <button
              type='submit'
              className='edit-form__save-button'
              name='avatar-edit-form-save-button'
            >
              Сохранить
            </button>
          </form>
        }
      />

      <PopupWithForm
        onClose={closeAllPopups}
        name='delete'
        title='Вы уверены?'
        children={
          <form name='delete-form' className='edit-form delete-form'>
            <button
              type='submit'
              className='edit-form__save-button'
              name='delete-form-save-button'
            >
              Да
            </button>
          </form>
        }
      />
    </>
  );
}

export default App;
